(139, 73, 'Restaurantes em Matosinhos: Comer bem na cidade do peixe', 'restaurantes-em-matosinhos-comer-bem-na-cidade-do-peixe', 'Conheça os melhores de Matosinhos a partir das avaliações realizadas pelo Boa Cama Boa Mesa﻿﻿!\r\n(Foto de capa: Casa de Chá da Boa Nova)', '<h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-1\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-1\">Dia 1</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-1\"><p>Conheça os melhores de Matosinhos a partir das avaliações realizadas pelo Boa Cama Boa Mesa!</p><p>No concelho com mais restaurantes por metro quadrado do país não é difícil descobrir espaços para saborear bom peixe e marisco frescos. Ingredientes que são reis dos restaurantes de Matosinhos e que valem bem uma viagem até à beira-mar. Saiba quais são os melhores restaurantes de Matosinhos para comer essencialmente peixe e marisco, mas não só.</p><p><br></p><div class=\"card local\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col-md-3 align-self-center\">\r\n                                        <a href=\"https://maps.google.com/?cid=12489790502876320890\" target=\"_blank\"><img class=\"img-fluid\" src=\"https://maps.googleapis.com/maps/api/place/js/PhotoService.GetPhoto?1sAap_uEBTY1BlWw6pzrNg0iQtqZrlMgfYq8iA3BsiylY7i30g7DcENpcx4ocAS2mcEHgd-re7zeAo8HnOEN80FB6rRbGhjbz1eE3heuB5Xo-AMtLMRn7jhyfmsMI7knIoSp-g_wEQouqzAVL3oYN6qqlZuLGdpOOpSLKwGM8z9kdnJNJ6Qur_&3u3872&5m1&2e1&callback=none&key=AIzaSyDnxBt7FH2nQeqQxiBNLckXyVfpHD0wF70&token=78322\" alt=\"Casa de Chá da Boa Nova\"></a>\r\n                                    </div>\r\n                                    <div class=\"col-md-9\">\r\n                                        <div class=\"card-body\">\r\n                                            <a href=\"https://maps.google.com/?cid=12489790502876320890\" class=\"link\" target=\"_blank\"><h5 class=\"card-title\">Casa de Chá da Boa Nova</h5></a>\r\n                                            <p class=\"card-text review\"><span class=\"stars\"><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star-half-alt\"></i></span><a href=\"https://maps.google.com/?cid=12489790502876320890\" class=\"link\" target=\"_blank\">4.7 no Google</a></p>\r\n                                            <p class=\"card-text\">Rua da Boa Nova, 4450-705 Leça da Palmeira, Portugal</p>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div><p>É no cenário deslumbrante da Casa de Chá da Boa Nova, obra emblemática de Siza Vieira a olhar o oceano que Rui Paula nos traz de volta à costa. Entre o mar e a terra, nas raízes transmontanas, o chefe retrata bem a essência da gastronomia portuguesa nos vários momentos dos menus de degustação, Atlântico, Mar e Terra, ambos de oito pratos, e Boa Nova, de quatro pratos, em abordagens como a Calçada portuguesa, a Caldeirada, o Bacalhau, ou a Feijoada à transmontana, novidades da carta. Com pouco mais de um ano, há mudanças assinaláveis que tornam este Monumento Nacional mais acolhedor. Arte e elementos decorativos acrescentam calor e conforto à sala e o serviço reflete essa renovação. No final, todos são convidados a conhecer os bastidores da casa, numa visita pela cozinha e impressionante garrafeira dotada de quase 800 referências. Preço médio: €100 Tel. 229 940 066</p><p><br></p><div class=\"card local\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col-md-3 align-self-center\">\r\n                                        <a href=\"https://maps.google.com/?cid=9966547357536505533\" target=\"_blank\"><img class=\"img-fluid\" src=\"https://maps.googleapis.com/maps/api/place/js/PhotoService.GetPhoto?1sAap_uEAl36vXcczfOW0i7aNQg_zGaiJGZylaZts3zUxXJMsUWdb5BknsMsPS7t9lQHVSKiH_MT_0tVFTLWeRiCfM6PBgRSA-hm-uFHDrabuOaXi2KCLPLKFL5PVVoX_JhcR7VdvwxzMjxo8kCt1ZcljGto7rBnHshbuC-Ifdey10sXbmBbf6&3u4160&5m1&2e1&callback=none&key=AIzaSyDnxBt7FH2nQeqQxiBNLckXyVfpHD0wF70&token=20239\" alt=\"Restaurante Sempr`assar\"></a>\r\n                                    </div>\r\n                                    <div class=\"col-md-9\">\r\n                                        <div class=\"card-body\">\r\n                                            <a href=\"https://maps.google.com/?cid=9966547357536505533\" class=\"link\" target=\"_blank\"><h5 class=\"card-title\">Restaurante Sempr`assar</h5></a>\r\n                                            <p class=\"card-text review\"><span class=\"stars\"><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star-half-alt\"></i></span><a href=\"https://maps.google.com/?cid=9966547357536505533\" class=\"link\" target=\"_blank\">4.4 no Google</a></p>\r\n                                            <p class=\"card-text\">R. Heróis de França 185, 4450-718 Matosinhos, Portugal</p>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div><p>É preciso descer mais um quarteirão para chegar à nova localização do Sempr&#039;Assar, agora no número 185 da mesma rua onde nasceu em 2003. Reconhecido pela qualidade e variedade dos peixes e mariscos, acrescenta à ementa o sushi, baseado na mesma frescura, sabor e respeito pelos ingredientes, e confecionado por experientes sushimen. O destaque maior vai para a cataplana e o arroz de Marisco e uma variedade de peixes grelhados no carvão, como pargo, rodovalho, garoupa e os populares sardinha e robalo. Preço médio: € 30 Rua Heróis de França, 185, Matosinhos. Tel. 229 385 808</p><p><br></p><div class=\"card local\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col-md-3 align-self-center\">\r\n                                        <a href=\"https://maps.google.com/?cid=8425426823741865071\" target=\"_blank\"><img class=\"img-fluid\" src=\"https://maps.googleapis.com/maps/api/place/js/PhotoService.GetPhoto?1sAap_uEAoV-h5JMsZIQAvtFHhgOpMeyxdJ_sY0Ta4DWy72lvOW29kk0ABGLcbbXKemaQsCBzIPopeB81G0LXDmA_QWhA-IZrFHSkzigpLjaZW3QyPPlamAFqGbngJvD464R69iKQ70DH3kat_kY9mbqE95FT9uD4tBB4J6fc7Epj3V1-IJxbS&3u854&5m1&2e1&callback=none&key=AIzaSyDnxBt7FH2nQeqQxiBNLckXyVfpHD0wF70&token=63952\" alt=\"Marisqueira Antiga\"></a>\r\n                                    </div>\r\n                                    <div class=\"col-md-9\">\r\n                                        <div class=\"card-body\">\r\n                                            <a href=\"https://maps.google.com/?cid=8425426823741865071\" class=\"link\" target=\"_blank\"><h5 class=\"card-title\">Marisqueira Antiga</h5></a>\r\n                                            <p class=\"card-text review\"><span class=\"stars\"><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star-half-alt\"></i></span><a href=\"https://maps.google.com/?cid=8425426823741865071\" class=\"link\" target=\"_blank\">4.5 no Google</a></p>\r\n                                            <p class=\"card-text\">R. Roberto Ivens 628, 4450-149 Matosinhos, Portugal</p>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div><p>Conhecida como a mais antiga marisqueira de Matosinhos, A Esplanada Marisqueira A Antiga conserva na essência aquilo que a celebrizou ao longo de quase 60 anos de vida. Marisco e lavagante em arroz ou açorda são as especialidades maiores da casa. Aqui é também inevitável servir também peixes nobres, em variedade e qualidade, dando preferência à sua confeção na grelha. Duas salas, uma delas para fumadores, acolhem bem, num ambiente clássico e elegante coincidindo com o serviço impecável e uma profunda carta de vinhos. Por último, mas não menos importante, a agradável esplanada é um oásis no tempo quente. Preço médio: € 40 Rua Roberto Ivens, 628-638, Matosinhos. Tel. 229 380 660</p><p><br></p><div class=\"card local\">\r\n                                <div class=\"row\">\r\n                                    <div class=\"col-md-3 align-self-center\">\r\n                                        <a href=\"https://maps.google.com/?cid=3180536944483753552\" target=\"_blank\"><img class=\"img-fluid\" src=\"https://maps.googleapis.com/maps/api/place/js/PhotoService.GetPhoto?1sAap_uECjI1TfUplPxU6rHl92SZHuonsvO9_I17HNOAhifCqxK7IV1yGMG38MscHdG6FwIOPiGrHuEvq-lkBYX3SPtlmLKBtdzOlEUYyvgM3oO3K8h9Vv1Pyr-nTz9YwY8l5VpF3VX19LSjO9QUA1Jxo6aE883XrRgth77Rq-Wx-1LHHpIs8I&3u1920&5m1&2e1&callback=none&key=AIzaSyDnxBt7FH2nQeqQxiBNLckXyVfpHD0wF70&token=114367\" alt=\"O Arquinho do Castelo\"></a>\r\n                                    </div>\r\n                                    <div class=\"col-md-9\">\r\n                                        <div class=\"card-body\">\r\n                                            <a href=\"https://maps.google.com/?cid=3180536944483753552\" class=\"link\" target=\"_blank\"><h5 class=\"card-title\">O Arquinho do Castelo</h5></a>\r\n                                            <p class=\"card-text review\"><span class=\"stars\"><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star\"></i><i class=\"fas fa-star-half-alt\"></i></span><a href=\"https://maps.google.com/?cid=3180536944483753552\" class=\"link\" target=\"_blank\">4.5 no Google</a></p>\r\n                                            <p class=\"card-text\">R. Castelo nr 51, 4450-682 Leça da Palmeira, Portugal</p>\r\n                                        </div>\r\n                                    </div>\r\n                                </div>\r\n                            </div><p>N&#039;O Arquinho do Castelo, em Leça da Palmeira, impera um ambiente ora desportivo, no piso superior, ora mais sóbrio, em baixo, onde um armário repleto de vinho serve de amparo à decoração. O serviço é diligente mas descontraído e no final, depois do peixe sempre fresco, grelhado, do polvo à Lagareiro ou do arroz de tamboril com gambas, além do cabrito assado, ao domingo, ou do arroz de pato, que também atraem clientela há mais de 20 anos. As sobremesas, em variedade, apresentam-se num carrinho. Tudo é temperado com muita simpatia. Preço médio: €30  Rua do Castelo, 53, Leça da Palmeira. Tel. 229951506</p><p><br></p><p>Por: Boa Cama Boa Mesa;<br>Retirado de: https://boacamaboamesa.expresso.pt/boa-mesa/2016-04-18-restaurantes-em-matosinhos-comer-bem-na-cidade-do-peixe</p></div>', '{\"lastInsertId\":18,\"content\":{\"day-1\":[{\"id\":1,\"type\":\"paragraph\",\"value\":\"Conheça os melhores de Matosinhos a partir das avaliações realizadas pelo Boa Cama Boa Mesa!\"},{\"id\":2,\"type\":\"paragraph\",\"value\":\"No concelho com mais restaurantes por metro quadrado do país não é difícil descobrir espaços para saborear bom peixe e marisco frescos. Ingredientes que são reis dos restaurantes de Matosinhos e que valem bem uma viagem até à beira-mar. Saiba quais são os melhores restaurantes de Matosinhos para comer essencialmente peixe e marisco, mas não só.\"},{\"id\":17,\"type\":\"paragraph\",\"value\":\"<br>\"},{\"id\":4,\"type\":\"local\",\"url\":\"https://maps.google.com/?cid=12489790502876320890\",\"image\":\"https://maps.googleapis.com/maps/api/place/js/PhotoService.GetPhoto?1sAap_uEBTY1BlWw6pzrNg0iQtqZrlMgfYq8iA3BsiylY7i30g7DcENpcx4ocAS2mcEHgd-re7zeAo8HnOEN80FB6rRbGhjbz1eE3heuB5Xo-AMtLMRn7jhyfmsMI7knIoSp-g_wEQouqzAVL3oYN6qqlZuLGdpOOpSL