(140, 56, 'A minha viagem a Lisboa', 'a-minha-viagem-a-lisboa', 'Itinerário de exemplo.', '<h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-1\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-1\">Dia 1</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-1\"><p>Itinerário de exemplo.</p></div><h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-2\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-2\">Dia 2</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-2\"><p>Itinerário de exemplo.</p></div>', '{\"lastInsertId\":4,\"content\":{\"day-1\":[{\"id\":1,\"type\":\"paragraph\",\"value\":\"Itinerário de exemplo.\"}],\"day-2\":[{\"id\":2,\"type\":\"paragraph\",\"value\":\"Itinerário de exemplo.\"}]}}', 2, 'files/default/lisboa.jpg', '2021-06-30 16:26:05', 0, 1),
(12, 56, 'Apresentação PAP - 06/07', 'apresentacao-pap-0607', 'Bem-vindos a bordo à apresentação da minha Prova de Aptidão Profissional. Boa viagem!', '<h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-1\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-1\">Dia 1</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-1\"><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_capa_60e326fd9df43.png\" alt=\"\">\r\n                            </div><p>O MyItinerary é uma aplicação Web de criação e partilha de itinerários turísticos de Portugal.<br><br>Com ela, os utilizadores podem criar os seus próprios itinerários ou explorar itinerários elaborados por outras pessoas, fazendo do MyItinerary uma espécie de rede social de roteiros de turismo.</p><p>Os itinerários podem ser criados para os seguintes fins (por exemplo):<br>- para descrever uma viagem já realizada, expondo os locais por onde tenhamos passado, de modo a partilhar a nossa experiência com outras pessoas;<br>- para planear uma viagem futura, descrevendo os locais que queremos visitar durante essa viagem.</p></div><h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-2\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-2\">Dia 2</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-2\"><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_capa-1_60e32a4b237ba.png\" alt=\"\">\r\n                            </div><p>Antes de iniciar o processo de desenvolvimento de qualquer aplicação, deve ser feita uma análise da ideia do projeto, bem como o respetivo mercado e concorrência. </p><p>É de sublinhar que o estudo realizado foi muito pouco profundo, tendo sido apenas feita uma pesquisa tentando encontrar Websites que oferecessem o mesmo serviço que o MyItinerary.</p><p>Um dos sites que mais captou a minha atenção foi o Inspirock. </p><p>Com um conceito semelhante ao do MyItinerary, a Inspirock permite aos utilizadores selecionarem uma localização (um continente, país ou cidade), sendo que esta entrega automaticamente um itinerário completo para o local escolhido.</p><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_captura-de-ecra-2021-07-05-165657_60e32bde4c2e2.jpg\" alt=\"\">\r\n                            </div><p>(Figura 1 - Página inicial da Inspirock)</p><p></p><p>Outra aplicação semelhante é o Google Trips.</p><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_captura-de-ecra-2021-07-05-170142_60e32cf48df01.jpg\" alt=\"\">\r\n                            </div><p>(Figura 2 - Página inicial do Google Trips)</p><p></p><p>Esta aplicação também oferece a possibilidade aos utilizadores de planear uma viagem futura, procurando locais de interesse na região da viagem, para depois serem visitados durante a mesma.</p><p></p><p>Posto isto, posso concluir que o desenvolvimento do MyItinerary poderá ser viável do  ponto  de  vista  de mercado,  dado  que  não  existem  plataformas conhecidas que ofereçam o mesmo tipo de serviço que o meu projeto.</p></div><h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-3\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-3\">Dia 3</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-3\"><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_capa-2_60e32e1f6b090.png\" alt=\"\">\r\n                            </div><p>Parte  fundamental  de  qualquer  projeto  ou organização,  a  identidade  visual  é  a principal  responsável  por  transmitir  uma  primeira  impressão  sobre  esse  objeto  ao utilizador/cliente. </p><p>Começando pelo logótipo, este foi concebido tendo em mente a simplicidade e o minimalismo que o resto da aplicação deverá adotar. <br>O resultado corresponde a um logótipo simples, do tipo &quot;wordmark&quot;, onde foi utilizado o tipo de letra &quot;Poppins&quot;.</p><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_captura-de-ecra-2021-07-05-171405_60e32fd497a4a.jpg\" alt=\"\">\r\n                            </div><p>(Figura 3 - Logótipo principal do MyItinerary)</p><p></p><p>A cor, elemento fundamental numa interface, foi projetada de forma a criar uma alusão à natureza e ao exterior. Posto isto, foram escolhidos o verde como cor principal, que remete para os espaços verdes, para o campo; e como cor secundária o azul, remetendo para o céu e para o mar.</p><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_captura-de-ecra-2021-07-05-171702_60e330858cdec.jpg\" alt=\"\">\r\n                            </div><p>(Figura 4 - Paleta das cores principais da plataforma)</p><p></p><p>No que toca à tipografia, a escolha passou por encontrar um tipo de letra elegante, simples e  sofisticado,  mas  que  não  ponha  em  causa  a  legibilidade do  conteúdo.</p><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_captura-de-ecra-2021-07-05-193237_60e3505107de2.jpg\" alt=\"\">\r\n                            </div><p>(Figura 5 - Amostra da fonte Inter)</p><p></p><p>A fonte escolhida, Inter, reúne todos os aspetos acima descritos.</p><p></p><p>Falando do design da aplicação, este foi todo desenvolvido de raiz por mim. Com um design moderno e minimalista, o MyItinerary proporciona uma experiência de navegação e utilização agradável a quem o utiliza.<br><br>No dia 4, aquando da Demonstração da Aplicação, mostrarei o design da aplicação com detalhe.</p></div><h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-4\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-4\">Dia 4</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-4\"><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_capa-3_60e34d7a605c2.png\" alt=\"\">\r\n                            </div><p>Passamos então à parte essencial desta apresentação: a demonstração da aplicação.</p></div><h4 class=\"divider\" id=\"divider\"><i class=\"fas fa-chevron-down\" id=\"icon\"></i><a onclick=\"ChangeArrow(this)\" class=\"link\" data-bs-toggle=\"collapse\" href=\"#day-5\" role=\"button\" aria-expanded=\"false\" aria-controls=\"day-5\">Dia 5</a></h4>\r\n                  <div class=\"collapse show\" id=\"day-5\"><div class=\"image\">\r\n                                <img class=\"img-fluid\" src=\"http://localhost/myitinerary.pt/files/public/56-itin_12-image_capa-4_60e34dcef1fb0.png\" alt=\"\">\r\n                            </div><p>Finalizamos com a apresentação e demonstração da parte de gestão do Website - o Backoffice.</p></div>', '{\"lastInsertId\":42,\"content\":{\"day-1\":[{\"id\":1,\"type\":\"image\",\"src\":\"%SITE_URL%/files/public/56-itin_12-image_capa_60e326fd9df43.png\"},{\"id\":3,\"type\":\"paragraph\",\"value\":\"O MyItinerary é uma aplicação Web de criação e partilha d