-itin_12-image_captura-de-ecra-2021-07-05-170142_60e32cf48df01.jpg\"},{\"id\":15,\"type\":\"paragraph\",\"value\":\"(Figura 2 - Página inicial do Google Trips)\"},{\"id\":16,\"type\":\"paragraph\",\"value\":\"\"},{\"id\":17,\"type\":\"paragraph\",\"value\":\"Esta aplicação também oferece a possibilidade aos utilizadores de planear uma viagem futura, procurando locais de interesse na região da viagem, para depois serem visitados durante a mesma.\"},{\"id\":18,\"type\":\"paragraph\",\"value\":\"\"},{\"id\":19,\"type\":\"paragraph\",\"value\":\"Posto isto, posso concluir que o desenvolvimento do MyItinerary poderá ser viável do  ponto  de  vista  de mercado,  dado  que  não  existem  plataformas conhecidas que ofereçam o mesmo tipo de serviço que o meu projeto.\"}],\"day-3\":[{\"id\":20,\"type\":\"image\",\"src\":\"%SITE_URL%/files/public/56-itin_12-image_capa-2_60e32e1f6b090.png\"},{\"id\":21,\"type\":\"paragraph\",\"value\":\"Parte  fundamental  de  qualquer  projeto  ou organização,  a  identidade  visual  é  a principal  responsável  por  transmitir  uma  primeira  impressão  sobre  esse  objeto  ao utilizador/cliente. \"},{\"id\":22,\"type\":\"paragraph\",\"value\":\"Começando pelo logótipo, este foi concebido tendo em mente a simplicidade e o minimalismo que o resto da aplicação deverá adotar. <br>O resultado corresponde a um logótipo simples, do tipo &quot;wordmark&quot;, onde foi utilizado o tipo de letra &quot;Poppins&quot;.\"},{\"id\":23,\"type\":\"image\",\"src\":\"%SITE_URL%/files/public/56-itin_12-image_captura-de-ecra-2021-07-05-171405_60e32fd497a4a.jpg\"},{\"id\":24,\"type\":\"paragraph\",\"value\":\"(Figura 3 - Logótipo principal do MyItinerary)\"},{\"id\":26,\"type\":\"paragraph\",\"value\":\"\"},{\"id\":27,\"type\":\"paragraph\",\"value\":\"A cor, elemento fundamental numa interface, foi projetada de forma a criar uma alusão à natureza e ao exterior. Posto isto, foram escolhidos o verde como cor principal, que remete para os espaços verdes, para o cam